import React, { Component } from 'react';

class Header extends Component {
    render() {
        return (
            <div>
                <center><h1>Tasnim Ali</h1></center>
            </div>
        );
    }
}



const head = {
    margin: '40px',
    border: '5px solid pink'
  };



export default Header;
